import React from 'react';

const Content=(props)=>{
    var contentClass = props.isOpen ? "dashboard-content open" : "dashboard-content close";
    return(
        <div 
        className={`contentClass${props.className ? ' ' + props.className : ''}`}
        />
    )
}
export {Content}
